css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("arduino.cc") {

  body {
    color: #777;
    background-color: #080808 !important;
  }
  
  table {
    background-color: #222 !important;
  }
  
  code {
    background-color: #0F1111;
    padding: 2px 6px 5px 6px;
    border-radius: 12px;
  }
  
  pre {
    background-color: #222929 !important;
  }
  
  .sourceblocktext {
    color: #bbb !important;
    background-color: #2E3535 !important;
  }
  
  .arduino .br0,
  .arduino .sy0 {
    color: #ccc !important;
  }
  
  .arduino .nu0 {
    color: #D43939 !important;    
  }
  
}
